// frontend/src/components/diagnosis/Diagnosis.js
import React, { useEffect, useMemo, useState, useCallback } from "react";
import safeStorage from "../../utils/safeStorage";

/**
 * Props:
 *  - xrayId:        ÏÑ†ÌÉùÎêú X-ray ID (App.jsÏóêÏÑú Ï†ÑÎã¨)
 *  - currentUser:   Î°úÍ∑∏Ïù∏ ÏÇ¨Ïö©Ïûê Ï†ïÎ≥¥ (ÏÑ†ÌÉù)
 *  - onNavigate:    ÌéòÏù¥ÏßÄ Ï†ÑÌôò Ìï∏Îì§Îü¨ (App.jsÏùò handleNavigate)
 *
 * ÎèôÏûë:
 *  - ÎßàÏö¥Ìä∏/ID Î≥ÄÍ≤Ω Ïãú ÏûêÎèôÏúºÎ°ú Î∞±ÏóîÎìúÏóê Î∂ÑÏÑùÏùÑ ÏöîÏ≤≠ÌïòÍ≥† Í≤∞Í≥ºÎ•º ÌëúÏãú
 *  - Î∞±ÏóîÎìú ÏóîÎìúÌè¨Ïù∏Ìä∏Îäî ÏïÑÎûò ENDPOINTS Ï§ë Ïã§Ï†ú ÏÇ¨Ïö© Ï§ëÏù∏ Í≤ÉÏúºÎ°ú ÎßûÏ∂∞ÏÑú Ïì∞ÏÑ∏Ïöî.
 */
function Diagnosis({ xrayId, currentUser, onNavigate }) {
  const [loading, setLoading] = useState(false);
  const [err, setErr] = useState(null);
  const [result, setResult] = useState(null);

  // --- üîß Ïó¨Í∏∞Ïóê Ïã§Ï†ú Î∞±ÏóîÎìú ÏóîÎìúÌè¨Ïù∏Ìä∏Î•º ÎßûÏ∂îÏÑ∏Ïöî ---
  // ‚ë† POST by-id (Ï∂îÏ≤ú: Î™ÖÌôï)
  // ‚ë° GET result?id= (Ïù¥ÎØ∏ Î∂ÑÏÑùÎêú Í≤∞Í≥ºÎ•º Ï°∞ÌöåÌïòÎäî Ïä§ÌÉÄÏùº)
  const ENDPOINTS = useMemo(
    () => ({
      POST_ANALYZE_BY_ID: "/api/analyze/by-id",
      GET_RESULT_BY_ID: (id) =>
        `/api/analyze/result?xrayId=${encodeURIComponent(id)}`,
    }),
    []
  );

  // ÌÜ†ÌÅ∞ Ìó§Îçî(ÏûàÏúºÎ©¥ ÏûêÎèô Ï≤®Î∂Ä) ‚Äî ÌîÑÎ°úÏ†ùÌä∏Ïóê ÎßûÍ≤å ÌÇ§ Ïù¥Î¶ÑÏùÑ Ï°∞Ï†ï
  const authHeaders = useMemo(() => {
    const token =
      safeStorage.getItem("accessToken") || safeStorage.getItem("token");
    return token ? { Authorization: `Bearer ${token}` } : {};
  }, []);

  const analyzeById = useCallback(
    async (id, signal) => {
      // ‚ö†Ô∏è Ïã§Ï†ú ÏùëÎãµ Ïä§ÌÇ§ÎßàÏóê ÎßûÍ≤å ÌååÏã± Î°úÏßÅÏùÑ Ï°∞Ï†ïÌïòÏÑ∏Ïöî.
      // Í∏∞ÎåÄ ÏòàÏãú:
      // { pred: "PNEUMONIA", prob: 0.83, overlayUrl: "...", originalUrl: "..." }
      // ÎòêÎäî { data: { ... } }
      // ÎòêÎäî { result: { ... } }
      // ÏïÑÎûòÎäî ‚ë†POST ‚Üí Ïã§Ìå® Ïãú ‚ë°GETÎ°ú Ìè¥Î∞±ÌïòÎäî Ìå®ÌÑ¥ÏûÖÎãàÎã§.

      // ‚ë† POST /api/analyze/by-id
      try {
        const res = await fetch(ENDPOINTS.POST_ANALYZE_BY_ID, {
          method: "POST",
          headers: {
            "Content-Type": "application/json",
            ...authHeaders,
          },
          body: JSON.stringify({ xrayId: id }),
          signal,
        });

        if (res.ok) {
          const data = await res.json();
          return (
            data?.result ||
            data?.data ||
            data || {
              pred: data?.pred,
              prob: data?.prob,
              overlayUrl: data?.overlayUrl,
              originalUrl: data?.originalUrl,
            }
          );
        }
        // Ïù¥Ïñ¥ÏÑú GETÏúºÎ°ú Ìè¥Î∞±
      } catch (e) {
        if (e.name === "AbortError") throw e;
        // Ìè¥Î∞± ÏßÑÌñâ
      }

      // ‚ë° GET /api/analyze/result?xrayId=...
      const res2 = await fetch(ENDPOINTS.GET_RESULT_BY_ID(id), {
        method: "GET",
        headers: {
          ...authHeaders,
        },
        signal,
      });

      if (!res2.ok) {
        const txt = await res2.text().catch(() => "");
        throw new Error(txt || "Î∂ÑÏÑù ÏöîÏ≤≠ Ïã§Ìå® (GET Ìè¥Î∞±)");
      }
      const data2 = await res2.json();

      return (
        data2?.result ||
        data2?.data ||
        data2 || {
          pred: data2?.pred,
          prob: data2?.prob,
          overlayUrl: data2?.overlayUrl,
          originalUrl: data2?.originalUrl,
        }
      );
    },
    [ENDPOINTS, authHeaders]
  );

  // ÎßàÏö¥Ìä∏/ID Î≥ÄÍ≤Ω Ïãú ÏûêÎèô Î∂ÑÏÑù
  useEffect(() => {
    if (!xrayId) return;
    let isActive = true;
    const ac = new AbortController();

    (async () => {
      try {
        setErr(null);
        setLoading(true);
        const payload = await analyzeById(xrayId, ac.signal);
        if (!isActive) return;

        // Ï†ïÍ∑úÌôî: ÎàÑÎùΩ ÌïÑÎìú ÎåÄÎπÑ Í∏∞Î≥∏Í∞í
        const normalized = {
          xrayId,
          pred: payload?.pred ?? "-",
          prob: typeof payload?.prob === "number" ? payload.prob : null,
          overlayUrl: payload?.overlayUrl ?? null,
          originalUrl: payload?.originalUrl ?? null,
          camLayer: payload?.camLayer ?? null,
          threshold: payload?.threshold ?? null,
